    "borderLeftColor": "transparent",
    "borderBottomColor": "var(--tooltip-color)",
    "borderRightColor": "transparent",
    "borderTopColor": "transparent",
    "top": "var(--tooltip-tail-offset)",
    "left": "50%",
    "right": "auto",
    "bottom": "auto"
  },
  ".tooltip-left:after": {
    "transform": "translateY(-50%)",
    "borderLeftColor": "var(--tooltip-color)",
    "borderBottomColor": "transparent",
    "borderRightColor": "transparent",
    "borderTopColor": "transparent",
    "top": "50%",
    "left": "auto",
    "right": "calc(var(--tooltip-tail-offset) + 1px)",
    "bottom": "auto"
  },
  ".tooltip-right:after": {
    "transform": "translateY(-50%)",
    "borderLeftColor": "transparent",
    "borderBottomColor": "transparent",
    "borderRightColor": "var(--tooltip-color)",
    "borderTopColor": "transparent",
    "top": "50%",
    "left": "calc(var(--tooltip-tail-offset) + 1px)",
    "right": "auto",
    "bottom": "auto"
  },
  ".tooltip-primary": {
    "-TooltipColor": "hsl(var(--p))",
    "-TooltipTextColor": "hsl(var(--pc))"
  },
  ".tooltip-secondary": {
    "-TooltipColor": "hsl(var(--s))",
    "-TooltipTextColor": "hsl(var(--sc))"
  },
  ".tooltip-accent": {
    "-TooltipColor": "hsl(var(--a))",
    "-TooltipTextColor": "hsl(var(--ac))"
  },
  ".tooltip-info": {
    "-TooltipColor": "hsla(var(--in) / .1)",
    "-TooltipTextColor": "hsl(var(--in))"
  },
  ".tooltip-success": {
    "-TooltipColor": "hsla(var(--su) / .1)",
    "-TooltipTextColor": "hsl(var(--su))"
  },
  ".tooltip-warning": {
    "-TooltipColor": "hsla(var(--wa) / .1)",
    "-TooltipTextColor": "hsl(var(--wa))"
  },
  ".tooltip-error": {
